"original": |2-
     A Printer object can represent either one or more physical Output
     Devices or a Logical Device that "processes" Jobs but never actually
     uses a physical Output Device to put marks on paper.  Examples of
     Logical Devices include a web page publisher or a gateway into an
     online Document archive or repository.  A Printer contains zero or
     more Job objects.
"fixed": |-
  A Printer object can represent either one or more physical Output Devices or a Logical Device that "processes" Jobs but never actually uses a physical Output Device to put marks on paper.  Examples of Logical Devices include a web page publisher or a gateway into an online Document archive or repository.  A Printer contains zero or more Job objects.
"ko": |-
  프린터 개체는 하나 이상의 물리적 출력 장치 또는 작업을 "처리"하지만 실제로 종이에 표시를 하기 위해 물리적 출력 장치를 사용하지 않는 논리적 장치를 나타낼 수 있습니다. 논리 장치의 예로는 웹 페이지 게시자 또는 온라인 문서 보관소 또는 저장소에 대한 게이트웨이가 있습니다. 프린터에는 0개 이상의 작업 개체가 포함되어 있습니다.
